This past weekend I had the absolute honor of decorating for @mangokiwimaria and @danielrtao proposal party!

@mangokiwimaria, photographer of @colorforbreakfast, is a true gem. I am so grateful for your friendship and for bringing me so much creative color and energy every time we meet!! You make San Diego and every room you step in so much brighter. I also just love seeing Mango and Kiwi play with Andy 🥹🥹 Grateful to have a pet portrait furrend, a small biz empathetic shoulder to lean on, and a fellow foodie ❤️ Excited for making more memories navigating life together!! Cheers to this next chapter and oh, what a fun one it’ll be 🥹💖

@danielrtao seeing the love and respect you share with Maria just fills my cup! I am always inspired by what an amazing partnership you guys have. Your trust in me and your unwavering support means so much! Every creative needs a partner like you— always down for the wild and sometimes nonsensical ideas, always filling in for issues at hand so that Maria can do her magic. And seeing you thrive on your own passions also keeps me and those around you motivated to aim higher, do better, and be kinder. 🥹🫶🏼

I am so so so happy for you both. Cheers to years of friendship and love!!! And pugs!!!!!

(Major thank you to fellow co conspired @frijolitocorgito Mahm for helping me paint, set up, blow balloons, and including goat cheese in the cheese spread 🤣)
